/**
 * Инициализация 12-ой нейронной сети
 */
static ann_Model_ref
ann_InitModel12( ann_Info_t *info) /* инфо */
{
    unsigned int layers_num = 3;
    unsigned int grid_size = 101;
    unsigned int options_num = 1;
    arr_Array_ptr weights = arr_NewArray( ARR_PROF_UNITS, layers_num, ARR_ZERO_INIT);
    arr_Array_ptr biases  = arr_NewArray( ARR_PROF_UNITS, layers_num, ARR_ZERO_INIT);
    arr_Array_ptr acts    = arr_NewArray( ARR_PROF_UNITS, layers_num, ARR_ZERO_INIT);
    arr_Array_ptr options = arr_NewArray( ARR_PROF_UNITS, options_num, ARR_ZERO_INIT);
    arr_Array_ptr grid    = arr_NewMatrix( ARR_PROF_UNITS, options_num, grid_size);
    ann_Option_ref option;
    unsigned int i, j;
    
    /* 1-ый слой */
    {
        const unsigned int m = 48; /* число нейронов на предыдущем слое */
        const unsigned int n = 50; /* число нейронов на данном слое */

        /* Создаём атрибуты слоя */
        arr_Array_ptr matrix = arr_NewMatrix( ARR_PROF_UNITS, m, n);
        arr_Array_ptr bias   = arr_NewArray( ARR_PROF_UNITS, n, ARR_ZERO_INIT);

        /* Заполняем атрибуты слоя */
        for ( i = 0; i < n; i++ )
        {
            for ( j = 0; j < m; j++ )
            {
                arr_SetMatrixProf( matrix, j, i, 
                                   fpa_ConvFloatVal( ann_Matrix_12_1[j][i]));
                arr_SetProf( bias, i, 
                             fpa_ConvFloatVal( ann_Bias_12_1[i]));
            }
        }

        /* Запоминаем атрибуты слоя */
        arr_SetPtr( weights, 0, (arr_Ptr_t)matrix);
        arr_SetPtr( biases, 0, (arr_Ptr_t)bias);
        arr_SetPtr( acts, 0, (arr_Ptr_t)ann_Relu);
    }

    /* 2-ый слой */
    {
        const unsigned int m = 50; /* число нейронов на предыдущем слое */
        const unsigned int n = 50; /* число нейронов на данном слое */

        /* Создаём атрибуты слоя */
        arr_Array_ptr matrix = arr_NewMatrix( ARR_PROF_UNITS, m, n);
        arr_Array_ptr bias   = arr_NewArray( ARR_PROF_UNITS, n, ARR_ZERO_INIT);

        /* Заполняем атрибуты слоя */
        for ( i = 0; i < n; i++ )
        {
            for ( j = 0; j < m; j++ )
            {
                arr_SetMatrixProf( matrix, j, i, 
                                   fpa_ConvFloatVal( ann_Matrix_12_2[j][i]));
                arr_SetProf( bias, i, 
                             fpa_ConvFloatVal( ann_Bias_12_2[i]));
            }
        }

        /* Запоминаем атрибуты слоя */
        arr_SetPtr( weights, 1, (arr_Ptr_t)matrix);
        arr_SetPtr( biases, 1, (arr_Ptr_t)bias);
        arr_SetPtr( acts, 1, (arr_Ptr_t)ann_Relu);
    }

    /* 3-ый слой */
    {
        const unsigned int m = 50; /* число нейронов на предыдущем слое */
        const unsigned int n = 101; /* число нейронов на данном слое */

        /* Создаём атрибуты слоя */
        arr_Array_ptr matrix = arr_NewMatrix( ARR_PROF_UNITS, m, n);
        arr_Array_ptr bias   = arr_NewArray( ARR_PROF_UNITS, n, ARR_ZERO_INIT);

        /* Заполняем атрибуты слоя */
        for ( i = 0; i < n; i++ )
        {
            for ( j = 0; j < m; j++ )
            {
                arr_SetMatrixProf( matrix, j, i, 
                                   fpa_ConvFloatVal( ann_Matrix_12_3[j][i]));
                arr_SetProf( bias, i, 
                             fpa_ConvFloatVal( ann_Bias_12_3[i]));
            }
        }

        /* Запоминаем атрибуты слоя */
        arr_SetPtr( weights, 2, (arr_Ptr_t)matrix);
        arr_SetPtr( biases, 2, (arr_Ptr_t)bias);
        arr_SetPtr( acts, 2, (arr_Ptr_t)ann_SoftMax);
    }

    /* Запоминаем опции, для которых обучена нейронная сеть, в заданном порядке */
    option = ann_NewOption( "regn_opers_limit", ANN_OPTION_FLOAT,
                            fpa_ConvIntVal( scr_GetIntOption( "regn_opers_limit")), 
                            info);
    arr_SetRef( options, 0, option);

    /* Запоминаем сетку значений опции, связанную с выходом нейронной сети */
    {
        const unsigned int m = 1; /* число опций компилятора */
        const unsigned int n = 101; /* число шагов в сетке */

        /* Заполняем стетку значений опций компилятора */
        for ( i = 0; i < m; i++ )
        {
            for ( j = 0; j < n; j++ )
            {
                arr_SetMatrixProf( grid, i, j, 
                                   fpa_ConvFloatVal( ann_Grid_12[i][j]));
            }
        }
    }

    return (ann_NewModel(layers_num, weights, biases, acts, options, grid, info));

} /* ann_InitModel12 */

